// Solidity program
// to admin
// donation Details
pragma solidity >=0.4.22 <0.9.0;

// Creating a Smart Contract
contract StructDemo{

// Structure of employee
struct donation{
	// State variables
	uint bid;
	uint uid;
	string donation;
	string date;
}

donation [] user;


// Function to add
// donation details
function addUser(uint bid,  uint uid, string memory d ,string memory da )public{
	donation memory  u = donation(bid, uid ,d,da);
	user.push(u);
}

}
